import React from 'react';
import { Link } from 'react-router-dom';

const Header: React.FC = () => {
    return (
        <nav>
            <Link to="/" onClick={() => window.location.reload()}>                Home
            </Link>
            {' | '}
            <Link to="/login" onClick={() => window.location.reload()}>
                Login
            </Link>
            {' | '}
            <Link to="/register" onClick={() => window.location.reload()}>
                Register
            </Link>
            {' | '}
            <Link to="/tasks" onClick={() => window.location.reload()}>
                Tasks
            </Link>
        </nav>
    );
};

export default Header;
